import { useSelector } from "react-redux";
import { selectValue } from "./app/taskReducerSlice";
import { selectText } from "./app/taskReducerSlice";

export default function Out() {

    const task1 = useSelector(selectValue);

    return(
        <div>
            <hr />
            <h2>Task1</h2>
            <p>{task1}</p>
        </div>
    );
}
